import React, { Component } from 'react';
import { Grid, Header } from 'semantic-ui-react'
import './Headers.scss'


class Headers extends Component {
  render() {
    return (
      <header>
        <nav>
          <p> <span className="link-nav">à propos de moi</span>
          <span className="link-nav">compétences</span>
          <span className="link-nav">portfolio</span>
          <span className="link-nav">contact</span>
          <span className="link-nav">télécharger mon c.v.</span>
          </p>
        </nav>
        <Grid columns={2} padded='vertically'>
          <Grid.Column>
            <Header size='huge'>Lisa Ferrier</Header>
            <Header size="medium" className="subtitle-header">Dév junior front-end
            </Header>
          </Grid.Column>
          <Grid.Column>

          </Grid.Column>
        </Grid>
      </header>
    );
  }
}

export default Headers;
